import { Link } from '@chakra-ui/react';
import Logo from './images/netflix.png'

function App() {
  return (
    <div className="flex items-center ">
        <img src={Logo} alt='' className="w-44 flex ml-5" />
        <div className="flex space-x-6 pl-5">
          <Link>Home</Link>
          <p>TV Shows</p>
          <p>Movies</p>
          <p>New & Popular</p>
          <p>My List</p>
          <p>Browse By Language</p>
        </div>
    </div>
  );
}

export default App;
